let allCategories = []; // mémoire du JSON complet

function loadCategories() {
  $.get("$value(BASE_URL)/contents/code/JSON-1768477913?status=SNAPSHOT&payloadOnly=true", function(categories) {
    allCategories = categories; // stocker pour filtrage
    populateFilters(categories);
    renderEbooks(categories);
  });
}

// Génère les listes déroulantes
function populateFilters(categories) {
  const catSelect = $("#categoryFilter");
  const subSelect = $("#subcategoryFilter");
  const linkedSelect = $("#linkedFilter");

  catSelect.empty().append('<option value="">All Categories</option>');
  categories.forEach(cat => catSelect.append(`<option value="${cat.name}">${cat.name}</option>`));

  subSelect.empty().append('<option value="">All Subcategories</option>');
  linkedSelect.empty().append('<option value="">All Linked Categories</option>');

  catSelect.off("change").on("change", function() {
    const selectedCat = $(this).val();
    updateSubAndLinkedFilters(selectedCat);
    filterEbooks();
  });

  subSelect.off("change").on("change", filterEbooks);
  linkedSelect.off("change").on("change", filterEbooks);
}

// Met à jour les sous-catégories et linked categories selon la catégorie sélectionnée
function updateSubAndLinkedFilters(categoryName) {
  const subSelect = $("#subcategoryFilter");
  const linkedSelect = $("#linkedFilter");

  subSelect.empty().append('<option value="">All Subcategories</option>');
  linkedSelect.empty().append('<option value="">All Linked Categories</option>');

  if(!categoryName) return;

  const cat = allCategories.find(c => c.name === categoryName);
  if(!cat) return;

  cat.subcategories.forEach(s => { if(s) subSelect.append(`<option value="${s}">${s}</option>`); });
  cat.linkedcategories.forEach(l => linkedSelect.append(`<option value="${l}">${l}</option>`));
}

// Filtrage dynamique
function filterEbooks() {
  const selectedCat = $("#categoryFilter").val();
  const selectedSub = $("#subcategoryFilter").val();
  const selectedLinked = $("#linkedFilter").val();

  let filtered = allCategories;

  if(selectedCat) filtered = filtered.filter(c => c.name === selectedCat);
  if(selectedSub) filtered = filtered.filter(c => c.subcategories.includes(selectedSub));
  if(selectedLinked) filtered = filtered.filter(c => c.linkedcategories.includes(selectedLinked));

  renderEbooks(filtered);
}

// Affiche les ebooks d’un tableau de catégories
function renderEbooks(categories) {
  const container = $("#ebooks");
  container.empty();

  categories.forEach(cat => {
    if (!cat.code) return;

    $.get(`$value(BASE_URL)/contents/code/${cat.code}?status=SNAPSHOT&payloadOnly=true`, function(ebooks) {
      if (!ebooks || ebooks.length === 0) return;

      ebooks.forEach(ebook => {
        const coverUrl = `$value(BASE_URL)/contents/code/${ebook.cover}/file?status=SNAPSHOT`;
        const ebookUrl = `$value(BASE_URL)/contents/code/${ebook.code}/file?status=SNAPSHOT`;

        container.append(`
          <div class="col-6 col-sm-4 col-md-3 col-lg-2 mb-4 d-flex">
            <div class="ebook-card d-flex flex-column w-100">
              <div class="ebook-cover mb-2" style="flex-shrink:0;">
                <img src="${coverUrl}" alt="${ebook.title}">
              </div>
              <div class="ebook-title text-truncate" title="${ebook.title}">${ebook.title}</div>
              <div class="ebook-desc" title="${ebook.description || ''}">${ebook.description || ''}</div>
              <div class="ebook-meta"><strong>Author:</strong> ${ebook.author || 'Unknown'}</div>
              <div class="mt-auto d-grid gap-1">
                <button class="btn btn-sm btn-primary w-100" onclick="openEbook('${ebookUrl}')">Open</button>
                <a href="${ebookUrl}" download class="btn btn-sm btn-outline-primary w-100">Download</a>
              </div>
            </div>
          </div>
        `);
      });
    });
  });
}



window.addEventListener("load", function() {
  function waitForjQuery(callback) {
    if (window.jQuery) callback();
    else setTimeout(() => waitForjQuery(callback), 50);
  }
  waitForjQuery(function() {
      loadCategories();
  });
});

/* Conteneur général des ebooks */
#ebooks {
  display: flex;
  flex-wrap: wrap;
  gap: 15px;
  justify-content: flex-start;
  padding: 10px;
  background: #f9f9f9;
}

/* Carte ebook */
.ebook-card {
  background: #fff;
  border-radius: 12px;
  border: 1px solid #e0e0e0;
  box-shadow: 0 2px 8px rgba(0,0,0,0.05);
  padding: 10px;
  display: flex;
  flex-direction: column;
  width: 100%;
  max-width: 180px; /* limite la largeur des cartes */
  transition: transform 0.2s, box-shadow 0.2s;
}

.ebook-card:hover {
  transform: translateY(-3px);
  box-shadow: 0 6px 15px rgba(0,0,0,0.1);
}

/* Couverture */
.ebook-card .ebook-cover {
  flex-shrink: 0;
  text-align: center;
  margin-bottom: 8px;
}

.ebook-card .ebook-cover img {
  width: 100%;
  height: 200px;
  object-fit: contain;
  border-radius: 8px;
  background: #f0f0f0;
}

/* Titre */
.ebook-title {
  font-size: 0.9rem;
  font-weight: 600;
  margin: 4px 0;
  text-align: center;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}

/* Description */
.ebook-desc {
  font-size: 0.8rem;
  color: #555;
  margin: 4px 0;
  text-align: center;
  overflow: hidden;
  display: -webkit-box;
  -webkit-line-clamp: 3; /* limite à 3 lignes */
  -webkit-box-orient: vertical;
}

/* Auteur et autres métadonnées */
.ebook-meta {
  font-size: 0.75rem;
  color: #777;
  text-align: center;
  margin-bottom: 6px;
}

/* Boutons */
.btn-open, .btn-download {
  font-size: 0.8rem;
  padding: 5px 6px;
  border-radius: 6px;
  width: 100%;
  margin-bottom: 4px;
  text-align: center;
}

.btn-open {
  background: #198754;
  color: #fff;
  border: none;
}

.btn-open:hover {
  background: #145c32;
}

.btn-download {
  background: #0d6efd;
  color: #fff;
  border: none;
}

.btn-download:hover {
  background: #084298;
}

/* Footer */
footer {
  position: fixed;
  bottom: 0;
  left: 0;
  width: 100%;
  background: #212529;
  color: white;
  text-align: center;
  padding: 10px;
}

/* Conteneur des filtres */
.filter-container {
  display: flex;
  flex-wrap: wrap;
  gap: 12px;
  padding: 12px 16px;
  background: #fff;
  border-bottom: 1px solid #ddd;
  border-radius: 8px;
  margin-bottom: 15px;
  box-shadow: 0 2px 6px rgba(0,0,0,0.05);
}

/* Style général des selects */
.filter-container select {
  padding: 8px 12px;
  border-radius: 8px;
  border: 1px solid #ccc;
  background: #f9f9f9;
  font-size: 0.9rem;
  min-width: 180px;
  cursor: pointer;
  transition: all 0.2s ease-in-out;
  appearance: none; /* cache la flèche native */
  background-image: url("data:image/svg+xml;utf8,<svg fill='%23666' height='16' viewBox='0 0 24 24' width='16' xmlns='http://www.w3.org/2000/svg'><path d='M7 10l5 5 5-5z'/></svg>");
  background-repeat: no-repeat;
  background-position: right 10px center;
  background-size: 16px;
}

/* Hover + focus */
.filter-container select:hover,
.filter-container select:focus {
  border-color: #0d6efd;
  background-color: #fff;
  outline: none;
  box-shadow: 0 0 6px rgba(13, 110, 253, 0.25);
}

/* Option dans la liste */
.filter-container option {
  padding: 8px;
}

/* Header */
header {
  background: #212529;
  color: white;
  text-align: center;
  padding: 10px 0;
  margin: 0;
}
header h1 { margin: 0; font-size: 1.6rem; }
header p { margin: 0; font-size: 0.9rem; color: #ddd; }

body {
  margin: 0;
  padding: 0;
  font-family: Arial, sans-serif;
  background: #f8f9fa;
}

